  return (
    <Container>

      {/* <Route path="/shop"     exact component={Shop}/> */}
      <LinkItem><Route path="/about" component={About}/></LinkItem>
      <LinkItem>About</LinkItem>
    </Container>
  );
}

export default MenuBar;
